import "./Profile.css";

import html from "../Images/icons/html.svg";
import css from "../Images/icons/css.svg";
import javascript from "../Images/icons/javascript.svg";
import typescript from "../Images/icons/typescript.svg";
import react from "../Images/icons/react.svg";
import angular from "../Images/icons/angular.svg";
import csharp from "../Images/icons/c-sharp.svg";
import express from "../Images/icons/express.svg";
import dotnet from "../Images/icons/dotnet.svg";
import node from "../Images/icons/node.svg";
import graphql from "../Images/icons/graphql.svg";
import mongodb from "../Images/icons/mongodb.svg";
import sql from "../Images/icons/sql.svg";
import firebase from "../Images/icons/firebase.svg";

import line from "../Images/line.png";
import fsd from "../Images/icons/full-stack-developer.svg";

import { Col, Row } from "react-grid-system";
import PortfolioComp from "./Portfolio";

function ProfileComp() {
  return (
    <div className='App'>
      {/* --- Header Row 1 --- */}
      <Row>
        <Col md={12}>
          <div className='profile_header'>
            <h1>Hello, I am Yohan Arejouane</h1>
            <h1>
              I am a Full-Stack Developer<span className='blink_me'>_</span>
            </h1>
          </div>
        </Col>
      </Row>

      <img
        src={line}
        alt='line'
        style={{ height: "50px", width: "90%", }}
      ></img>

      {/* --- Bio Row 2 --- */}

      <Row>
        <Col md={6}>
          <img style={{ height: "350px", width: "auto" }} src={fsd}></img>
        </Col>

        <Col md={6}>
          <div className='profile_description'>
            <p>
              Technion Certified Full Stack Developer, I create Web Sites and
              Web Apps from scratch using the most advanced technologies. Mostly using MERN Stack.
            </p>
          </div>
        </Col>
      </Row>

      {/*  */}

      <PortfolioComp />

      {/* --- My Stack Row 3 --- */}
      <Row>
        <Col md={12}>
          <div className="profile_stack">
            <h1 className="profilestackHeader">My Stack<span className='blink_me'>_</span></h1> <br></br>
            <img className="profile_stackIcon" src={html} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={css} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={javascript} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={typescript} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={react} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={angular} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={csharp} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={node} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={graphql} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={express} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={dotnet} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={sql} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={mongodb} alt='Stack Client Logo' />
            <img className="profile_stackIcon" src={firebase} alt='Stack Client Logo' />
          </div>
        </Col>
      </Row>


    </div>
  );
}

export default ProfileComp;
